import React from 'react';

import { useState } from 'react';

function Form() {
    const [name, setName] = useState('');
    const [title, setTitle] = useState('');
    const [Created_by, setBy] = useState('');
    const [Created_on, setOn] = useState('');
    const [Deadline, setDl] = useState('');

    // const [status, setStatus] = useState('');

    const handleButton = (click) => {
        click.preventDefault();
        console.log(name)
        console.log(title)
        console.log(Created_by)
        console.log(Created_on)
        console.log(Deadline)

    }



    return (
        <div className='form'       >
            <div className='App2'>
                <input for='name' type='text' onChange={(click)=>{setName(click.target.value)}} value={name} placeholder='title'/>
                <input for='title' type='text' onChange={(click)=>{setTitle(click.target.value)}} value={title} placeholder='title'/>
                <input for='Created_By' type='text' onChange={(click)=>{setBy(click.target.value)}} value={Created_by} placeholder='title'/>
                <input for='Created_On' type='text'onChange={(click)=>{setOn(click.target.value)}} value={Created_on} placeholder='title'/>
                <input for='Deadline' type='date' onChange={(click)=>{setDl(click.target.value)}} value={Deadline} placeholder='title'/>
                {/* <Dropdown/> */}
                <button onClick ={handleButton}>Submit</button>

            </div>
        </div>
    )
};

export default Form;
